// FindQueryG retrieves a single record by ID.
func FindQueryG(iD int, selectCols ...string) (*Query, error) {
	return FindQuery(boil.GetDB(), iD, selectCols...)
}

// FindQuery retrieves a single record by ID with an executor.
// If selectCols is empty Find will return all columns.
func FindQuery(exec boil.Executor, iD int, selectCols ...string) (*Query, error) {
	queryObj := &Query{}

	sel := "*"
	if len(selectCols) > 0 {
		sel = strings.Join(strmangle.IdentQuoteSlice(dialect.LQ, dialect.RQ, selectCols), ",")
	}
	query := fmt.Sprintf(
		"select %s from \"queries\" where \"id\"=$1", sel,
	)

	q := queries.Raw(query, iD)

	err := q.Bind(nil, exec, queryObj)
	if err != nil {
		if errors.Cause(err) == sql.ErrNoRows {
			return nil, sql.ErrNoRows
		}
		return nil, errors.Wrap(err, "models: unable to select from queries")
	}

	return queryObj, nil
}

